import React, { Fragment } from "react";
import { Button, Typography } from "@material-ui/core";

import { HomeButtonContainer } from "./homepage.styles";

import Parallax from "../../components/parallax/parallax.component";
import InfoArea from "../../components/InfoArea/infoArea.component";

import {
  ArrowDropDownCircleTwoTone,
  UpdateTwoTone,
  ChatBubbleTwoTone,
  MonetizationOnTwoTone,
} from "@material-ui/icons";

//Material UI
import Grid from "@material-ui/core/Grid";

import Directory from "../../components/directory/directory.component";

const HomePage = () => {
  const image =
    "https://thumbor.thedailymeal.com/l89JXqysFyBCS2k0KPcrqH52OP8=/870x565/https://www.theactivetimes.com/sites/default/files/uploads/r/rsz_front_shutterstock_364445939.jpg";
  return (
    <Fragment>
      <Parallax filter image={image} />

      <Grid container justify="center">
        <HomeButtonContainer>
          <a href="#Directory">
            <Button
              variant="contained"
              color="Secondary"
              startIcon={<ArrowDropDownCircleTwoTone />}
              endIcon={<ArrowDropDownCircleTwoTone />}
            >
              Visit Our Store Now
            </Button>
          </a>
        </HomeButtonContainer>
      </Grid>

      <Directory />

      <Grid container justify="space-around">
        <Grid Item xs={10} md={6}>
          <Typography variant="h1" align="center">
            Let's talk product
          </Typography>
          <p>
            It's in this paragraph were we can write more details about Our
            Yousfitness Brand's products. Keep you user engaged by providing
            meaningful information. Remember that by this time, the user is
            curious, otherwise he wouldn't scroll to get here. We're alse
            thinking about adding a CTA ( call to action ) button !
          </p>
        </Grid>

        <Grid container justify="space-around">
          <Grid item xs={12} md={4} justify="center" alignItems="center">
            <InfoArea
              title="The Fastest Shipping"
              description="Divide details about your product or agency work into parts. Write a few lines about each one. A paragraph describing a feature will be enough."
              icon={UpdateTwoTone}
              iconColor="info"
              vertical
            />
          </Grid>

          <Grid item xs={12} md={4}>
            <InfoArea
              title="The Best Customer Service"
              description="Divide details about your product or agency work into parts. Write a few lines about each one. A paragraph describing a feature will be enough."
              icon={ChatBubbleTwoTone}
              iconColor="info"
              vertical
            />
          </Grid>

          <Grid item xs={12} md={4}>
            <InfoArea
              title="The Lowest Prices"
              description="Divide details about your product or agency work into parts. Write a few lines about each one. A paragraph describing a feature will be enough."
              icon={MonetizationOnTwoTone}
              iconColor="success"
              vertical
            />
          </Grid>
        </Grid>
      </Grid>
    </Fragment>
  );
};

export default HomePage;
